import Stopwatch from "../components/Lockone/Stopwatch";

class TimerStore {
    // initialize your state 
    constructor(initialState) {
        this.timerObj = initialState;
    }

    // set state 
    setState(state) {
        this.timerObj = state;
    }

    // get state 
    getState() {
        return this.timerObj;
    }
}

const timerStore = new TimerStore({});
export default timerStore;


